import React from "react";
import Sdata from "./Sdata";
import Netflix from "./Netflix";
const Amazon = () => {
    return(
        <Netflix 
        imgsrc = {Sdata[2].imgsrc}
        title = {Sdata[2].title}
        sname = {Sdata[2].sname}
        link = {Sdata[2].link}
        />
    );
};

export default Amazon;
